import React from 'react';
import { Link } from 'react-router-dom';

function SurveyCards({ surveys }) {
  return (
    <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
      {surveys.map((survey) => (
        <div key={survey.id} className="bg-white rounded-lg shadow hover:shadow-md transition-shadow duration-300 p-4">
          <h2 className="font-semibold text-lg">{survey.title}</h2>
          <p className="text-gray-600">{survey.description}</p>
          {/* Replace with actual image source */}
          <img src="/path-to-image.jpg" alt="Survey" className="w-full h-32 object-cover rounded mt-2" />
          <Link 
            to={`/survey/${survey._id}`}
            className="mt-3 bg-blue-500 text-white rounded px-4 py-2 hover:bg-blue-600 transition-colors duration-300 block text-center"
          >
            Start Survey
          </Link>
        </div>
      ))}
    </div>
  );
}

export default SurveyCards;
